import '../style/Costitem.css';



function Costitem () {

    const costDate = new Date(2021, 2, 12);
    const costName = 'холодильнк'
    const costAmount = 999.99;


    return <div className='cost-item'>
        <div>{costDate.getDay}</div>
        <div className='cost-item__description'>
            <h2>{costName}</h2></div>
        <div className='cost-item__price'>${costAmount}</div>
    </div>
}

export default Costitem;
